pub(crate) fn deploy(registry: &[u8; 20], team_multisig: &[u8; 20]) {
    let gas_limit = 10_000_000;
    let max_fee_per_gas = U256::from(1_250_000_000);

    // use contract bytecode + constructor parameters
    let mut init = CONTRACT_BYTECODE.to_vec();
    init.append(
        encode(&vec![
            Token::Address(registry.into()),
            Token::Address(team_multisig.into()),
        ])
        .as_mut(),
    );

    // create parachain governance contract
    assert_ok!(EVM::create(
        RuntimeOrigin::root(),
        ALITH.into(),
        init,
        U256::zero(),
        gas_limit,
        max_fee_per_gas,
        None,
        None,
        Vec::new()
    ));
    System::assert_last_event(
        pallet_evm::Event::Created {
            address: GOVERNANCE_CONTRACT_ADDRESS.into(),
        }
        .into(),
    );
}

pub(crate) fn init(staking: &[u8; 20]) {
    let gas_limit = 10_000_000;
    let max_fee_per_gas = U256::from(1_250_000_000);

    #[allow(deprecated)]
    let input = Function {
        name: "init".to_string(),
        inputs: vec![Param {
            name: "_parachainStaking".to_string(),
            kind: ParamType::Address,
            internal_type: None,
        }],
        outputs: vec![],
        constant: None,
        state_mutability: Default::default(),
    }
    .encode_input(&vec![Token::Address(staking.into())])
    .unwrap();

    // init parachain governance contract
    assert_ok!(EVM::call(
        RuntimeOrigin::root(),
        ALITH.into(),
        GOVERNANCE_CONTRACT_ADDRESS.into(),
        input,
        U256::zero(),
        gas_limit,
        max_fee_per_gas,
        None,
        None,
        Vec::new()
    ));
    System::assert_has_event(
        pallet_evm::Event::Executed {
            address: H160(GOVERNANCE_CONTRACT_ADDRESS),
        }
        .into(),
    );
}
